def _partition_tasks(worker):
    """
    Takes a worker and sorts out tasks based on their status.
    Still_pending_not_ext is only used to get upstream_failure, upstream_missing_dependency and run_by_other_worker
    """
    tasks = worker.tasks()
    still_pending_not_ext = []
    still_pending_ext = []
    pending_ext = []
    pending_not_ext = []
    running = []
    failed = []
    skipped = []
    ext_failed = []
    ext_skipped = []
    for task in tasks:
        if task.status() == 'running':
            running.append(task)
        elif task.status() == 'failed':
            failed.append(task)
        elif task.status() == 'skipped':
            skipped.append(task)
        elif task.status() == 'extended_failure':
            ext_failed.append(task)
        elif task.status() == 'extended_skipped':
            ext_skipped.append(task)
        elif task.status() == 'still_pending_not_ext':
            still_pending_not_ext.append(task)
        elif task.status() == 'still_pending_ext':
            still_pending_ext.append(task)
        elif task.status() == 'pending_ext':
            pending_ext.append(task)
        elif task.status() == 'pending_not_ext':
            pending_not_ext.append(task)
        else:
            raise Exception('Unknown status: {}'.format(task.status()))
    return still_pending_not_ext, still_pending_ext, pending_ext, pending_not_ext, running, failed, skipped, ext_failed, ext_skipped
